def readData():
    pixels = []
    next(sys.stdin)
    for line in sys.stdin:
        row = []
        for p in line.split(" "):
            vals = [int(val) for val in p.split(",")]
            row.append(sum(vals)/len(vals))
        pixels.append(row)
    return np.array(pixels, dtype = np.uint8)

def prepareData(data):
    x = []
    threshold = 100
    
    startLocX = 7
    endLocX = 21
    startLocY = 6
    increment = 8
    for i in range(5):
        char = data[startLocX:endLocX, startLocY:startLocY + increment]
        char[char > threshold] = 255
        startLocY = startLocY + increment + 1
        x.append(char.ravel())
    return x
        

